import React, { useState } from 'react'
import { Text, View, StyleSheet, TouchableOpacity, Image } from 'react-native'
import { LinearGradient } from 'expo-linear-gradient'
import { MorphImageButton } from './MorphImageButton'
import { MorphSequenceButton } from './MorphSequenceButton'
import { ImageUploadButton } from './ImageUploadButton'

export default function MorphSuccessView({resetMorphState}) {

return (
    <LinearGradient
    // Background Linear Gradient
    colors={['#c2e9fb', '#a1c4fd']}
    style={styles.background}
    start={[0, 0]}
    end={[1, 1]}
    >
    <View style={styles.container}>
        <MorphImageButton
        firstImageRef={firstImageRef}
        secondImageRef={secondImageRef}
        morphImageResponse={morphImageResponse}

        setFirstImageRef={setFirstImageRef}
        setSecondImageRef={setSecondImageRef}
        setMorphImageResponse={setMorphImageResponse}
        />
    </View>
    <View style={styles.container}>
        <MorphSequenceButton
        firstImageRef={firstImageRef}
        secondImageRef={secondImageRef}
        />
    </View>
    <View>
        <TouchableOpacity onPress={() => resetMorphState()} style={styles.morphArea}>
            <Image source={require('./../../assets/redo-arrow.png')} style={styles.reset}></Image>
        </TouchableOpacity>
    </View>
</LinearGradient>
)
}

const styles = StyleSheet.create({
  background: {
    flex: 1
  },
  morphArea: {
    bottom: 50,
    justifyContent: 'center',
    alignItems: 'center',
    flex: 1
  },
  title: {
    marginTop: 30,
    fontSize: 40,
    textAlign: 'center',
    color: '#2b2b2b',
    fontWeight: 'bold',
    fontFamily: 'Roboto'
  },
  container: {
    flex: 1,
    flexDirection: 'column',
  },
  reset: {
    width: 40,
    height: 40,
    margin: 25
  }
})
